tables.table_schema:
CREATE TABLE NeuralNetworkTrainingLogs (
  log_id SERIAL PRIMARY KEY,
  training_id INT NOT NULL,
  log_timestamp TIMESTAMPTZ NOT NULL,
  log_message TEXT
);

CREATE TABLE neural_network_logs (
    log_id INT PRIMARY KEY,
    training_timestamp TIMESTAMP,
    training_loss FLOAT,
    training_accuracy FLOAT
);

CREATE TABLE optimization_logs (
    log_id INT PRIMARY KEY,
    optimization_timestamp TIMESTAMP,
    optimization_loss FLOAT,
    optimization_accuracy FLOAT
);

CREATE TABLE neural_network_logs (
    log_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    message TEXT
);

CREATE TABLE optimizer_logs (
    optimizer_id INT PRIMARY KEY,
    optimizer_name TEXT,
    learning_rate FLOAT,
    momentum FLOAT
);
